css:
@-moz-document domain('rent.591.com.tw'), url-prefix('https://rent.591.com.tw/map-index') {
    #mapContainer {
        height: calc(100vh - 45px);
        display: flex;
        flex-direction: column;
    }
    .nav-wrapper {
        margin-bottom: 0px !important;
    }
    .nav-wrapper .nav {
        height: 45px !important;
        line-height: 47px !important;
    }
    .nav-wrapper .nav .logo a{
        height: 45px;
    }
    .mapKeywordSearch {
        top: 5px;
    }
    #mapHeader {
        height: 143px;
    }
    .nav-list {
        display: none;
    }
    .login-status {
        display: none;
    }
    #areaSelect a {
        width: 200px !important;
    }
    #area_city li, #area_province li {
        width: auto;
    }
    #searchBox {
        top: 45px;
    }
    #searchBox .w88 {
        width: 110px;
    }
}
